import React, { useState } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { PageBreadcrumb } from "../breadcrumb/Breadcrumb.comp";
import { AddTicketForm } from "../add-ticket-from/AddTicketForm.comp";

export const Addticketpage = () => {
  const [priority, setPriority] = useState("");
  const [status, setStatus] = useState("");
  const [addedAt, setAddedAt] = useState("");
  const [subject, setSubject] = useState("");
  const handleOnSelectedChange = (selected) => {
    props.changeMarket(selected);
  };
  const handleOnChange = (e) => {
    const { name, value } = e.target;

    switch (name) {
      case "priority":
        setPriority(value);
        break;
      case "subject":
        setSubject(value);
        break;
      case "status":
        setStatus(value);
        break;
      case "addedAt":
        setAddedAt(value);
        break;
      default:
        break;
    }
    console.log(name, value);
  };
  return (
    <Container>
      <hr />
      <Row>
        <Col>
          <PageBreadcrumb page="Nouveau Ticket" />
        </Col>
      </Row>
      <Row>
        <Col>
          <AddTicketForm
            handleOnSelectedChange={handleOnSelectedChange}
            handleOnChange={handleOnChange}
            priority="priority"
            subject="subject"
            addedAt="AddedAt"
          />
        </Col>
      </Row>
    </Container>
  );
};
